#!/bin/bash

TARGET=artik710s
DATE=2018.5.29

#Package Check
if [ "`dpkg -l | grep sharutils | awk '{print $2}'`" == "" ]; then
	echo "Please install sharutils package."
	echo "sudo apt-get install sharutils"
	exit
fi

echo TARGET=${TARGET}
echo DATE=${DATE}

#Delete dirty files
if [ -e nsih.txt ]; then
	rm -f nsih.txt
fi

if [ -e bl1.img ]; then
	rm -f bl1.img
fi

if [ -e fip-loader.img ]; then
	rm -f fip-loader.img
fi

if [ -e downloader ]; then
	rm -f downloader
fi

